  false,\n\t\"url\": null,\n\t\"notes\": \"LOCATION: Lat. 39036u201919u201dN, long.
  9307u201948u201dW near Swan Lake NWR, 23.5 miles southeast of Chillicothe, MO, in
  Charlton County. Gage is mounted 9 feet off the ground on a tree in the woods downstream
  of the bridge on the left bank. DRAINAGE AREA: 414 square miles SURFACE WATER RECORDS
  PERIOD OF RECORD: June 24, 2010 to present. GAGE SITE JUN 2010 u2013 DEC 2011: Sutron
  Monitor 1 in metal gage housing in communication with a KPSI submersible pressure
  transducer mounted on a fencepost in the streambed near old railroad bridge. Instruments
  are powered by asolar panel run to a battery inside the gage housing. Stage data
  are collected at 15 minute intervals. Datum of gage is in North American Vertical
  Datum of 1988. GAGE SITE DEC 2011: New logger installed December 1, 2011. Design
  Analysis 522+ in communication with Esterline pressure transducer in a square metal
  gage house. GOES antenna in communication with DA 522+ DCP transmits everyhour in
  a 10 second window at a baud rate of 300. Instruments are powered by a solar panel
  run to a battery through a Sunsaver power regulator. Solar panel, GPS and GOES antennas
  are attached to a mast connected to the gage house. Stage is collected at 15u2010minute
  intervals. Weekly gage height data available online, NWS Id is MDOM7. NATIONAL WILDLIFE
  REFUGE: Swan Lake NWRREMARKS: Records coded fair for 2011 calendar year. EXTREMES
  FOR PERIOD OF RECORD: Maximum gage height, 676.81 ft, June 28, 2010; minimum gage
  height, 660.40 ft, October 4, 2011. EXTREMES FOR CURRENT YEAR: Maximum gage height,
  676.45 ft, April 23; minimum gage height, 660.40 ft Oct 4.\",\n\t\"owner_org\":
